--  DDL for View ROLES
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "ST52501"."ROLES" ("ID_ROLE", "NAZEV", "OPRAVNENI", "POZNAMKA", "ID_UZIVATELE") AS 
  select ro.id_role,ro.nazev,ro.opravneni,ro.poznamka, uz.id_uzivatele
            from role ro
                     inner join role_uzivatele ruz on ruz.id_role = ro.id_role
                     inner join uzivatele uz on uz.id_uzivatele = ruz.id_uzivatele
;
--------------------------------------------------------
--  DDL for View ROLE_UZIV
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "ST52501"."ROLE_UZIV" ("ID_ROLE") AS 
  SELECT COUNT(ru.id_role_uzivatele) id_role
from role_uzivatele ru
;
--------------------------------------------------------
--  DDL for View ROLE_UZIV2
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "ST52501"."ROLE_UZIV2" ("ID_ROLE") AS 
  SELECT COUNT(ru.id_role_uzivatele) id_role
from role_uzivatele ru
GROUP BY(ru.id_role)
;
--------------------------------------------------------
--  DDL for View UZIVATELE_VIEW
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "ST52501"."UZIVATELE_VIEW" ("ID_UZIVATELE", "JMENO", "PRIJMENI", "EMAIL", "BLOKACE") AS 
  select id_uzivatele,jmeno,prijmeni,email,blokace
from uzivatele
;
--------------------------------------------------------
--  DDL for View VIEW_TOP_LEAF
--------------------------------------------------------

  CREATE OR REPLACE FORCE EDITIONABLE VIEW "ST52501"."VIEW_TOP_LEAF" ("ZAMESTNANEC_ID", "JMENO", "PRIJMENI", "EMAIL", "TELEFON", "DATUM_NASTUP", "POZICE_ID", "MZDA", "PROVIZE_PROCENT", "MANAZER_ID", "ODDELENI_ID") AS 
  SELECT "ZAMESTNANEC_ID","JMENO","PRIJMENI","EMAIL","TELEFON","DATUM_NASTUP","POZICE_ID","MZDA","PROVIZE_PROCENT","MANAZER_ID","ODDELENI_ID" FROM A_HR.ZAMESTNANCI
WHERE CONNECT_BY_ISLEAF = 1
CONNECT BY MANAZER_ID = PRIOR ZAMESTNANEC_ID
START WITH MANAZER_ID IS NULL
;
