Insert into ST52501.STUDIJNI_OBORY (ID_OBORU,NAZEV,POPIS) values (2612060,'Komunikacni a mikroprocesorova technika','Bakalarsky prezencni (3 roky) studijni program je urcen pro pripravu vysokoskolsky vzdelanych odborniku s uplatnenim v elektrotechnickem  prumyslu, ale i v dalsich odvetvich 
se zamerenim na aplikaci mikroprocesoru a pocitacu pri rizeni, kontrole, ovladani i diagnostice elektronickych systemu a zarizeni.');
Insert into ST52501.STUDIJNI_OBORY (ID_OBORU,NAZEV,POPIS) values (1802007,'Informacni technologie','Bakalarske studium je zamereno predevsim na oblast informacnich technologii z hlediska metod zpracovani informaci, programovacich jazyku, vystavby a spravy databazi, aplikaci systemove analyzy, spravy a obsluhy pocitacovych siti');
Insert into ST52501.STUDIJNI_OBORY (ID_OBORU,NAZEV,POPIS) values (3902046,'Rizeni procesu','Cilem bakalarskeho oboru je pripravit odborniky pro uplatneni v prumyslu v oblasti mereni a automatickeho rizeni, a to v projekci, vyrobe, sprave, diagnostice a udrzbe mericich, informacnich, automatizacnich, zabezpecovacich a obdobnych zarizeni');
